import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';

const Home = () => {

    const [packages, setPackages] = useState([]);

    useEffect(() => {
        fetch('http://localhost:9000/packages')
            .then(res => res.json())
            .then(data => setPackages(data))
    }, [])

    return (
        <div className='my-5'>
            <h2>Our Packages</h2>

        </div>
    );
};

export default Home;
